import { Container, Row ,Col, Card, Button} from "react-bootstrap"
import { useState } from "react"
const Containerr=(props)=>{
    const [num,setnum]=useState('0')
    const inc=(val)=>{
        setnum(num+1)
    }
    const dec=(val)=>{
        setnum(num-1)
    }
    return(
        <>
            <Container className="mt-5" >
                <Row>
                    <Col xs={4}>
                        <Card className="shadow-lg">
                            <Card.Body>
                              
                                <p  className="display-2">count</p>
                                <Button onClick={()=>{inc}} variant="warning" className="m-1">Decreamtn</Button>
                                <Button  onClick={()=>{dec}} variant="primary" className="m-1">Increament</Button>
                            </Card.Body>
                        </Card>
                     
                    </Col>
                </Row>

            </Container>
        </>
    )
}
export default Containerr
